import "./components/UI/W3.css";
import MenuRow from "./components/UI/MenuRow";

const expenses = [
  {
    id: "e1",
    title: "Toilet Paper",
    amount: 94.12,
    date: new Date(2019, 7, 14),
  },
  { id: "e2", title: "New TV", amount: 799.49, date: new Date(2021, 2, 12) },
  {
    id: "e3",
    title: "Car Insurance",
    amount: 294.67,
    date: new Date(2021, 2, 28),
  },
  {
    id: "e4",
    title: "New Desk (Wooden)",
    amount: 450,
    date: new Date(2021, 5, 12),
  },
];

function addExpenseHandler(expense) {
  console.log("In App.js");
  console.log(expense);
}

function App() {
  return (
    <div class="w3-row">
      <div class="w3-half w3-lime w3-center" style={{height: "600px"}}>
        <div class="w3-padding-64">
          <h1>¡Evitemos rescates innecesarios!</h1>
          <h4>
            Nosotros te ayudamos, da click al botón de abajo para completar un
            formulario para guiarte en este proceso.
          </h4>
          <button class="w3-button w3-black w3-round-xxlarge w3-hover-khaki">
            Ir al Formulario
          </button>
        </div>
        <div class="w3-row">
          <div class="w3-half"></div>
          <div class="w3-half"></div>
        </div>
      </div>
      <div class="w3-half w3-white w3-container" style={{height: "600px"}}>
        <div class="w3-padding-64 w3-center">
          <h1>Conocé nuestra Organización</h1>
          <div class="w3-center-align w3-padding-large">
            <button class="w3-button w3-black w3-round-xxlarge w3-hover-khaki">
              Visitar Página Web
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
